// styles.js

export const sliderStyles = {
    container: {
      width: '100%',
      height: '5px',
      background: '#ddd',
      borderRadius: '5px',
      margin: '20px 0',
      position: 'relative',
    },
    track: {
      background: '#ddd',
      height: '5px',
      borderRadius: '5px',
      position: 'relative',
    },
    range: {
      background: '#17A2B8',
      height: '5px',
      borderRadius: '5px',
      position: 'absolute',
      top: 0,
      left: 0,
    },
    thumb: {
      height: '17px',
      width: '17px',
      backgroundColor: '#17A2B8',
      borderRadius: '50%',
      cursor: 'pointer',
      boxShadow: '0 0 6px rgba(0,0,0,0.05)',
    },
    rangeValues: {
      display: 'flex',
      justifyContent: 'space-between',
      fontSize: '14px',
      marginTop: '5px',
    },
  };
